--
-- Name: timescaledb; Type: EXTENSION; Schema: -; Owner: -
--

CREATE EXTENSION IF NOT EXISTS timescaledb WITH SCHEMA public;


--
-- Name: EXTENSION timescaledb; Type: COMMENT; Schema: -; Owner: -
--

COMMENT ON EXTENSION timescaledb IS 'Enables scalable inserts and complex queries for time-series data';


--
-- Name: entsoe_production_types; Type: TYPE; Schema: public; Owner: -
--

CREATE TYPE public.entsoe_production_types AS ENUM (
    'biomass',
    'fossil_brown_coal/lignite',
    'fossil_coal-derived_gas',
    'fossil_gas',
    'fossil_hard_coal',
    'fossil_oil',
    'fossil_oil_shale',
    'fossil_peat',
    'geothermal',
    'hydro_pumped_storage',
    'hydro_run-of-river_and_poundage',
    'hydro_water_reservoir',
    'marine',
    'nuclear',
    'other',
    'other_renewable',
    'solar',
    'waste',
    'wind_offshore',
    'wind_onshore'
);


--
-- Name: source_types; Type: TYPE; Schema: public; Owner: -
--

CREATE TYPE public.source_types AS ENUM (
    'entsoe',
    'elexon',
    'svk_mimer',
    'svk_controlroom',
    'eirgrid'
);


--
-- Name: trigger_set_updated_at(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.trigger_set_updated_at() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  NEW.updated_at = NOW();
  RETURN NEW;
END;
$$;


SET default_tablespace = '';

SET default_table_access_method = heap;

--
-- Name: generation; Type: TABLE; Schema: public; Owner: -
--

CREATE TABLE public.generation (
    area_id integer NOT NULL,
    production_type public.entsoe_production_types NOT NULL,
    value integer NOT NULL,
    "time" timestamp without time zone NOT NULL,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    CONSTRAINT fr_nuclear CHECK ((NOT ((area_id = 12) AND (production_type = 'nuclear'::public.entsoe_production_types) AND (value > 80000))))
);


